// PuppyCultureGuide.js
import React from 'react';
import PuppyOwnersGuide from './PuppyOwnersGuide';
import BreedersGuide from './BreedersGuide';
import UsefulInformation from './UsefulInformation';

const PuppyCultureGuide = () => {
  return (
    <div>
      <h1>Your Guide to Puppy Culture</h1>
      <p>
        Puppy Culture is a complete program of over 50 lessons - from whelping box to new home.

        From early neurological stimulation, to aggression prevention, to potty training, manding, and leash walking, it's all here!
        Learn from top veterinary behaviorists, breeders, and dog trainers - scientifically proven to greatly improve outcomes for puppies!
        With step-by-step instructions on what to do at each critical juncture in the first 12 weeks of life and beyond, Puppy Culture is your guide to raising your puppies to be calm enrichment seekers, ready to take on life's challenges with love and joy to spare.
        The Puppy Owners Guide To Puppy Culture
        The Breeders Guide To Puppy Culture
        Puppy Culture is available in 2 media formats:
BUY DVD
BUY STREAMING
But what if my puppy is older / younger / not raised with the Puppy Culture program?



Don't worry! You're in luck; the science based training and protocols in Puppy Culture are perfect for puppies of all ages.



Even though the film focuses on the first 12 weeks of a puppy's life, there are more than 30 lessons that are directed specifically to prospective puppy families that can be applied well after the 12 week mark - including manding, early leash walking, and crate training.
      </p>
      <PuppyOwnersGuide />
      <BreedersGuide />
      <UsefulInformation />
    </div>
  );
};

export default PuppyCultureGuide;
